import ExpenseItem from "./components/ExpenseItem";

function App() {
  const data = [
    {
      id: 1,
      title: 'Car Insurance',
      date: new Date(2022, 2, 14),
      amount: 234.54
    },
    {
      id: 2,
      title: 'Toilet Paper',
      date: new Date(2022, 3, 1)
    }
  ]
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem title="Toilet Paper" amount="$234" date="23-10-2020"/>
      <ExpenseItem title="Car Insurance" amount="$254.67" date="23-10-2020"/>
    </div>
  );
}

export default App;
